window.bookSummaryJSON = "<p>Byron Shaw can track and find anyone on Earth. Except the people who tried to kill him. </p> <p>By 2081, privacy no longer exists. The Lattice enables anyone to re-live any moment of your life. People can experience past and present events - or see into the mind of anyone, living or dead. </p> <p>Most people love it. Some want to destroy it. </p> <p>Colonel Byron Shaw has just saved the Lattice from the most dangerous attack in its history. Now he must find those responsible. But there's a question nobody's asking: does the Lattice deserve to be saved? </p> <p>The answer may cost him his life. </p>"; 
